import styled from 'styled-components';

import logo from '../../assets/logo.svg';

export const Container = styled.div`
  background: #000;
  flex: 1;
`;
export const Logo = styled.h1`
  width: 340px;
  height: 155px;
  background-image: url(${logo});
`;
